import { Link } from "react-router-dom"

function Footer(){
    return(
        <div className="footer text-center py-3 bg-primary">© 2024 Copyright: MedHub
        <Link to="https://github.com/Yves-Shaheem/applicationWeb.git"><i class="fa-brands fa-github"></i></Link>
        </div>
);

}


export default Footer;
